function WordDictionary({data}){
    const items = [
        {
            title : "Definition:",
            content : data.meanings[0].definitions[0].definition
        },
        {
            title : "Parts of speech:",
            content : data.meanings[0].partOfSpeech
        },
        {
            title : "Synonyms:",
            content : data.meanings[0].synonyms[0]
        },
        {
            title : "Antonyms:",
            content : data.meanings[0].antonyms[0]
        }
    ]
    const renderedTitle = items.map(item => <tr className="p-2 pe-3"><th>{item.title}</th></tr>)
    const renderedContent = items.map(item => <tr className="p-2 pe-3"><td>{item.content}</td></tr>)
    return(
        <table>
            <thead>
                {renderedTitle}
            </thead>
            <tbody>
                {renderedContent}
            </tbody>
        </table>
    )
}
export default WordDictionary;
